    playbackData.comments = {"992991d9-e1b3-432c-963e-75483aecfefd":[{"id":"841c7269-2e1f-4bea-ae63-e976dcb8f353","displayCommentEventId":"992991d9-e1b3-432c-963e-75483aecfefd","displayCommentEventSequenceNumber":0,"developerGroupId":"3bb63d03-76ec-4d38-bb72-3347be22276f","timestamp":1731692078654,"commentText":"A playback introducing <span style=\"font-family: Courier;\">str_view()</span> as a method for implementing our very first regex expressions.&nbsp; We cover character classes, alternation, and some metacharacters.&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"4c682a0a-84bf-49d1-9714-3ac3795a23f1":[{"id":"57d65ac4-b6cf-4a6f-baa2-3bb3c77b5550","displayCommentEventId":"4c682a0a-84bf-49d1-9714-3ac3795a23f1","displayCommentEventSequenceNumber":146,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731692690840,"commentText":"Motivation!","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1731696863494-Regex-Intro.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"d0d999b9-e638-4523-bb3a-4765cda737e5":[{"id":"3c53d8c9-d210-415d-8aaf-ef3e96d5be57","displayCommentEventId":"d0d999b9-e638-4523-bb3a-4765cda737e5","displayCommentEventSequenceNumber":173,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731692730663,"commentText":"fruit is a dataset built into the <span style=\"font-family: Courier;\">tidyverse</span> that is just a long <span style=\"font-weight: bold;\">c</span>ollection of strings:","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731692727534-AllFruit.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"b3eabc13-5566-470f-a14a-9ea0bde16ab3":[{"id":"17678e77-c2a7-4050-b98b-b8d8f9415cac","displayCommentEventId":"b3eabc13-5566-470f-a14a-9ea0bde16ab3","displayCommentEventSequenceNumber":242,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731693236600,"commentText":"<span style=\"font-family: Courier;\">str_view()</span> is a great function for helping us identify how the computer is internally processing a string (can be used to identify odd characters or whitespace gaps) AND to help us visualize certain substrings or patterns within a collection of strings.&nbsp; You can see lots of examples with it in the <a href=\"https://stringr.tidyverse.org/reference/str_view.html\">documentation</a>.<div><br></div><div>The first argument we pass to <span style=\"font-family: Courier;\">str_view() </span>is a word or list of words we wish to search for particular patterns.&nbsp; The second argument we pass is.... the pattern we are looking for, within quotations.&nbsp; &nbsp;Interestingly, this pattern here is&nbsp;<span style=\"font-style: italic;\">regex</span> (remember, short for <span style=\"font-weight: bold;\">reg</span>ular <span style=\"font-weight: bold;\">ex</span>pression).&nbsp; For our first example, we have used a so called <span style=\"font-style: italic;\">string literal, </span>where we are searching the list of fruits for all fruit that contain the literal word <span style=\"font-family: Courier;\">\"berry\"</span>.</div><div><br></div><div>The output of <span style=\"font-family: Courier;\">str_view() </span>is shown below.&nbsp; Notice that the portion of each word that fits the input pattern is a different color and our attention is brought to it by encasing it in angled brackets <span style=\"font-family: Courier;\">&lt;&gt;</span>.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731692751042-AllBerries.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["str_view()","image"],"questionCommentData":null}],"68df5c17-fff7-4923-b438-7f60d7ec5a63":[{"id":"39842d7e-5f60-4ba5-beef-3a99be1484bd","displayCommentEventId":"68df5c17-fff7-4923-b438-7f60d7ec5a63","displayCommentEventSequenceNumber":328,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731693582921,"commentText":"Please ignore the mistake I made with <span style=\"font-family: Courier;\">str_view()</span> being typed as <span style=\"font-family: Courier;\">str_fruit()</span>.&nbsp; I guess I had berries on the brain!","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731693520469-BerryFunny.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null},{"id":"f0a41d6b-9d9d-481c-a3ae-1689b6ad1ec3","displayCommentEventId":"68df5c17-fff7-4923-b438-7f60d7ec5a63","displayCommentEventSequenceNumber":328,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731693708480,"commentText":"In this line of code, we are <span style=\"font-weight: bold;\">not</span> searching the list of fruit for the literal substring <span style=\"font-family: Courier;\">[aeiou]</span>; I don't expect words to contain brackets at all, and I don't know of any words that contain all vowels in a row.&nbsp; Instead, the <span style=\"font-family: Courier;\">[]</span> characters have a special meaning and are used to create a range of possible values called a <span style=\"font-style: italic;\">character class</span>.<div><br></div><div>The video below introduces these ideas further.</div>","commentTitle":"","position":1,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1731697619514-Regex-I.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"fe390b4b-66fc-49d3-b73c-b08c06a71860":[{"id":"00b5c411-72cc-47e6-94b0-ac6b8a66c7c3","displayCommentEventId":"fe390b4b-66fc-49d3-b73c-b08c06a71860","displayCommentEventSequenceNumber":386,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731693853584,"commentText":"The image below is the output of line 10 of the code (again, with <span style=\"font-family: Courier;\">fruit </span>changed to <span style=\"font-family: Courier;\">view</span>).&nbsp; Notice how <span style=\"font-family: Courier;\">str_view()</span> will highlight ALL subportions of the string that match the pattern.&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731693818926-AllFruit2.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"e94d7fb9-2322-4fbd-a370-9d6e0d04eabf":[{"id":"ee6a8838-a91e-4dbf-8068-09893a2071f1","displayCommentEventId":"e94d7fb9-2322-4fbd-a370-9d6e0d04eabf","displayCommentEventSequenceNumber":421,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731693987984,"commentText":"Yet another punctuation symbol with a particular meaning is <span style=\"font-family: Courier;\">^</span>, which we use as a symbol for \"begins with\".&nbsp; Thus if we want to see all fruits that BEGIN with a vowel, not just the fruits that contain a vowel (i.e. all of them) we can attach this <span style=\"font-family: Courier;\">^</span> to the start of the character class <span style=\"font-family: Courier;\">[aeiou]</span> to communicate we want strings that start with a vowel (or any pattern).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731693978868-FruitVowels.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"11759f98-4a40-46fc-b6b5-3104b35d5be1":[{"id":"bf77f55d-fb03-45cb-abc4-a60ecabd5c43","displayCommentEventId":"11759f98-4a40-46fc-b6b5-3104b35d5be1","displayCommentEventSequenceNumber":573,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731694114784,"commentText":"Character classes allow us to search for individual letters that match a list of options.&nbsp; if we want to search for larger substrings that could fall into one of several possibilities, we can list these substrings and separate them by <span style=\"font-family: Courier;\">| </span>symbols.&nbsp; This process is called alternation (we are picking between <span style=\"font-style: italic;\">alternative</span> patterns).","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731694111833-DoubleLetterFruit.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"1c2000af-f320-4a6d-9fd9-1e1be85f1ea8":[{"id":"555a861b-7e25-4db3-b0c2-c19c2f96c67c","displayCommentEventId":"1c2000af-f320-4a6d-9fd9-1e1be85f1ea8","displayCommentEventSequenceNumber":659,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731694253849,"commentText":"If we want to indicate that we are searching for strings that end with a specific letter or letters, we can use <span style=\"font-family: Courier;\">$</span> at the end of the character class in the same way we used <span style=\"font-family: Courier;\">^</span> to indicate what the first letter of a word must be.&nbsp; Note that <span style=\"font-family: Courier;\">^</span> goes before the character class and <span style=\"font-family: Courier;\">$</span> goes after to remind you of the special meanings of those symbols.<div><br></div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731694245249-EndsWithVowel.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"756bad6f-3e8c-4c47-a256-c03f933b8445":[{"id":"26c51a68-1f73-4c72-839d-c1131a664d5a","displayCommentEventId":"756bad6f-3e8c-4c47-a256-c03f933b8445","displayCommentEventSequenceNumber":781,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731694405273,"commentText":"We can put together character classes and alternation to find all fruits that either start OR end with a vowel (or maybe both!)","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731694400653-StartsOrEndsVowel.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"31923dc7-84d1-451e-85ff-01225d00073d":[{"id":"8eb3a4a6-5979-4257-84b3-4fdad50a4866","displayCommentEventId":"31923dc7-84d1-451e-85ff-01225d00073d","displayCommentEventSequenceNumber":833,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731694509296,"commentText":"You might think that if we want to find two patterns at once with regex, we might use<span style=\"font-family: Courier;\"> &amp;</span> similar to how we used <span style=\"font-family: Courier;\">|</span> somewhat analogously to or.&nbsp; This isn't actually necessary, however; we can just use the tools we already have!&nbsp;","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"55c77710-6e19-4f5a-be54-edde5357e41d":[{"id":"6db20e8b-757f-4d91-a752-065e3ecd5457","displayCommentEventId":"55c77710-6e19-4f5a-be54-edde5357e41d","displayCommentEventSequenceNumber":884,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731694800149,"commentText":"Our computer is smart enough to understand that lower and upper case letters of the alphabet are ordered, so instead of typing <span style=\"font-family: Courier;\">[abcdefghijlkmnopqrstuvwxyz]</span> to mean \"any lowercase letter is allowable\", regex allows us to abbreviate this with a hyphen, using <span style=\"font-family: Courier;\">[a-z]</span> to denote this instead.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["question"],"questionCommentData":{"allAnswers":["0","4"],"correctAnswer":"0","question":"Having looked at the full list of fruits earlier, how many do you think are returned by this regex pattern?","explanation":"The computer reads this list of regex requirements as:<div>1. Starts with a vowel</div><div>2. Contains exactly one letter between a and z (inclusive)</div><div>3. Ends with a vowel</div><div><br></div><div>No such fruits in our list satisfy this!</div>"}}],"0d66525e-14ff-4d7b-99d7-e807cd3e2fe2":[{"id":"1061158b-4881-4290-914b-3f25cc160809","displayCommentEventId":"0d66525e-14ff-4d7b-99d7-e807cd3e2fe2","displayCommentEventSequenceNumber":994,"developerGroupId":"f05ed45e-9d78-42d5-8666-6b4994e8f029","timestamp":1731694982312,"commentText":"When we mean starts with a vowel and ends with a vowel, that's all we really care about.&nbsp; We don't know AND don't care how many intermediate letters come between the start and end of the word.<div><br>To indicate that the pattern in the character class can repeat any number of times (0 - practically infinite) we can use a <span style=\"font-family: Courier;\">* </span>at the end of the character class to communicate this.&nbsp; The symbol <span style=\"font-family: Courier;\">+</span> has <span style=\"font-style: italic;\">almost</span>&nbsp;the same effect; it forces at least one occurrence of the pattern in the character class to occur, but places no maximum on the total number of times the pattern occurs.</div><div><br></div><div>This regex will give us the expected output below:</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1731694957255-StartsAndEndsVowel.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/regexI.R","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}]};
